import React, { useState } from 'react';
import BaseLayer from './BaseLayer';

const Conv2DLayer = () => {
    const [filterSize, setFilterSize] = useState(3);
    const [numFilters, setNumFilters] = useState(32);
    const [activationFunction, setActivationFunction] = useState('relu');

    const handleFilterSizeChange = (event) => {
        setFilterSize(event.target.value);
    };

    const handleNumFiltersChange = (event) => {
        setNumFilters(event.target.value);
    };

    const handleActivationFunctionChange = (event) => {
        setActivationFunction(event.target.value);
    };

    return (
        <div className="conv2d-layer">
            <h3>Conv2D Layer</h3>
            <div>
                <label>Filter Size:</label>
                <input type="number" value={filterSize} onChange={handleFilterSizeChange} />
            </div>
            <div>
                <label>Number of Filters:</label>
                <input type="number" value={numFilters} onChange={handleNumFiltersChange} />
            </div>
            <div>
                <label>Activation Function:</label>
                <select value={activationFunction} onChange={handleActivationFunctionChange}>
                    <option value="relu">ReLU</option>
                    <option value="sigmoid">Sigmoid</option>
                    <option value="tanh">Tanh</option>
                </select>
            </div>
        </div>
    );
};

export default Conv2DLayer;
